    false,nt"url": null,nt"notes": "Liquefaction susceptibility hinges on two
    key criteria, a shallow water table and the presence of a fine-grained confining
    unit, or cap, over cohesionless sand deposits as seen in the study area. Liquefaction
    is most likely to occur when the thickness of this clay-rich cap is five meters
    (16.4 feet) or less. For thicknesses greater than five meters but less than 10 meters
    (32.8 feet) the susceptibility drops from high to moderate. At thicknesses greater
    than 10 meters, susceptibility approaches zero. The purpose of this map is to help
    define liquefaction hazard criteria. Clay cap thicknesses were determined using
    existing well log data.",nt"license_title": null,nt"extras": [{ntt"key":
